class Fooditem extends Component{
    render() {
        return(
            <>
                <div className="food-content">
                    <div className="img"></div>
                    <div className="name line-clamp-2">苹果</div>
                    <div className="price">123</div>
                </div>
            </>
        );
    }
}
export default Fooditem;
